      <div className="header-content">
        <h1>Hi! I'm</h1>
        <h2 className="fullname">Prince Olusegun Ojugbele</h2>
        <h2>
          I'm a{" "}
          <Typical
            steps={[
              "Full Stack Developer ‚úçÔ∏è",
              1000,
              "Backend Developer ‚úÖ",
              1000,
              "Frontend Developer üöÄ",
              1000,
              "Mobile-App Developer üò°",
              1000,
            ]}
            loop={Infinity}
            wrapper="b"
          />
        </h2>
      </div>
    </div>
  );
}

export default Header;
